import React from 'react';
import Box from '@material-ui/core/Box';
import Button from '@material-ui/core/Button';


function Topnav() {
    return (
        <div className="topnav">
            <Box color="text.primary">
                <Button />
            </Box>
        </div>
    );
}

export default Topnav;
